import "./Chart.css";
import ChartBar from "./ChartBar";

const Chart = (props) => {
  const expenses = props.exp;
  return (
    <div className="chart">
      <ChartBar
          key={Math.random().toString()}
          value={expenses.value}
          maxVal={1000}
        />
      {/* {expenses.map((m) => (
        
      ))} */}
    </div>
  );
};

